import React from 'react';
import ReactDOM from 'react-dom';

const Header = (props) => (
    <>
    <h1>{props.course}</h1>
    </>
)

const Content = (props) => (
    <>
    <p> {props.description} {props.value}</p>
    </>
)

const Total = (props) => (
    <>
    <p> Number of exercises = {props.values.reduce((a,b) => a + b, 0)}</p>
    </>
)

const App = () => {
    const course = "Half Stack app development"
    const part1 = 'Fundamentals of React'
    const exercises1 = 10
    const part2 = "Using props to pass data"
    const exercises2 = 7
    const part3 = "State of component"
    const exercises3 = 15

    return (
        <div>
            <Header course={course}/>
            <Content description={part1} value={exercises1}/>
            <Content description={part2} value={exercises2}/>
            <Content description={part3} value={exercises3}/>
            <p>Number of exercises {exercises1 + exercises2 + exercises3}</p>
        </div>
    )
}

ReactDOM.render(<App />, document.getElementById('root'));
